import styles from './Log.module.css';
import LinkButton from '../components/LinkButton';
import Input from '../components/Input';

function Cadastrar(){
    return(
        <section className={styles.section}>
            <h1>Cadastro</h1>
            <form>
                <div className={styles.inputDiv}>
                    <p>Insira seu nome de usuário:</p>
                    <input type="text" placeholder="Usuário" name="username"/>
                    <p>Insira seu email:</p>
                    <input type="text" placeholder="Email" name="email"/>
                    <p>Insira sua senha:</p>
                    <input type="password" placeholder="Senha" name="password1"/>
                    <p>Confirme sua senha:</p>
                    <input type="password" placeholder="Senha" name="password2"/>
                </div>
                <button className={styles.btn}>Cadastrar</button>
            </form>
            <span/>
            <LinkButton to="/" text="Voltar"/>
        </section>
    )
}

export default Cadastrar;
